import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import "bootstrap/dist/css/bootstrap.min.css"
import * as serviceWorker from './serviceWorker';
import TableSort from "../src/components/TableSort";
import CardSortTest from "../src/components/CardSortTest";

ReactDOM.render(<App />, document.getElementById("root"));
// ReactDOM.render(<CardSortTest />, document.getElementById("root"));

